import React from 'react';

const SoftSkills = () => {
	return(		
		<div className="tc fl w-100 pa2">
          <p>Teamwork, organization and time management, loyal, intelligence</p>
          <p>self-knowledge, development of executive presentations, </p>
          <p>feedback learning, honest, dedicated, industrious and</p>
          <p>emotional intelligence.</p>
    </div> 	   
	);
}

export default SoftSkills;
